import React from 'react';


export default function TxList({ txs }) {
    if (txs.length === 0) return null;

    return (
        <>
            {txs.map(item => (
                <div key={item} className=''>
                    <div className=''>
                        <p>{item.hash}</p>
                    </div>
                </div>
            ))}
        </>
    );
}
